-- Create Database
CREATE DATABASE MovieDB;
USE MovieDB;

show tables;
-- Create Tables

-- Create Person Table
CREATE TABLE Person (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Name VARCHAR(100) NOT NULL,
    Birth_Date DATE,
    Nationality VARCHAR(50),
    Awards TEXT
) ENGINE=InnoDB;

-- Trigger for Birth_Date Validation (Insert)
DELIMITER //
CREATE TRIGGER trigger_validate_birth_date_insert
BEFORE INSERT ON Person
FOR EACH ROW
BEGIN
    IF NEW.Birth_Date > CURDATE() THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Birth_Date cannot be in the future';
    END IF;
END //
DELIMITER ;

-- Trigger for Birth_Date Validation (Update)
DELIMITER //
CREATE TRIGGER trigger_validate_birth_date_update
BEFORE UPDATE ON Person
FOR EACH ROW
BEGIN
    IF NEW.Birth_Date > CURDATE() THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Birth_Date cannot be in the future';
    END IF;
END //
DELIMITER ;

-- Create Movie Table
CREATE TABLE Movie (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Title VARCHAR(255) NOT NULL,
    Release_Date DATE,
    Duration INT,
    Rating DECIMAL(3,1),
    Metadata JSON,
    CONSTRAINT chk_duration CHECK (Duration > 0),
    CONSTRAINT chk_rating CHECK (Rating BETWEEN 0 AND 10)
) ENGINE=InnoDB;

-- Trigger for Release_Date Validation (Insert)
DELIMITER //
CREATE TRIGGER trigger_validate_release_date_insert
BEFORE INSERT ON Movie
FOR EACH ROW
BEGIN
    IF NEW.Release_Date > CURDATE() THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Release_Date cannot be in the future';
    END IF;
END //
DELIMITER ;

-- Trigger for Release_Date Validation (Update)
DELIMITER //
CREATE TRIGGER trigger_validate_release_date_update
BEFORE UPDATE ON Movie
FOR EACH ROW
BEGIN
    IF NEW.Release_Date > CURDATE() THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Release_Date cannot be in the future';
    END IF;
END //
DELIMITER ;

CREATE TABLE Role (
    Movie_ID INT,
    Person_ID INT,
    Role_Type ENUM('Actor', 'Director', 'Producer') NOT NULL,
    Character_Name VARCHAR(100),
    PRIMARY KEY (Movie_ID, Person_ID, Role_Type),
    FOREIGN KEY (Movie_ID) REFERENCES Movie(ID) ON DELETE CASCADE,
    FOREIGN KEY (Person_ID) REFERENCES Person(ID) ON DELETE RESTRICT
) ENGINE=InnoDB;

CREATE TABLE Genre (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Name VARCHAR(50) NOT NULL,
    Description TEXT
) ENGINE=InnoDB;

ALTER TABLE Genre DROP INDEX Name;


CREATE TABLE Movie_Genre (
    Movie_ID INT,
    Genre_ID INT,
    PRIMARY KEY (Movie_ID, Genre_ID),
    FOREIGN KEY (Movie_ID) REFERENCES Movie(ID) ON DELETE CASCADE,
    FOREIGN KEY (Genre_ID) REFERENCES Genre(ID) ON DELETE RESTRICT
) ENGINE=InnoDB;

CREATE TABLE Distributor (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Name VARCHAR(100) NOT NULL,
    Headquarters VARCHAR(255),
    Contact_Info JSON
) ENGINE=InnoDB;

CREATE TABLE User (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Username VARCHAR(50) NOT NULL UNIQUE,
    Email VARCHAR(100) NOT NULL UNIQUE,
    Preferences TEXT
) ENGINE=InnoDB;

CREATE TABLE Review (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    User_ID INT,
    Movie_ID INT,
    Rating INT,
    Comment TEXT,
    Review_Date DATE DEFAULT (CURDATE()),
    FOREIGN KEY (User_ID) REFERENCES User(ID) ON DELETE SET NULL,
    FOREIGN KEY (Movie_ID) REFERENCES Movie(ID) ON DELETE CASCADE,
    CONSTRAINT chk_review_rating CHECK (Rating BETWEEN 1 AND 10)
) ENGINE=InnoDB;

-- Create Award Table
CREATE TABLE Award (
    ID INT AUTO_INCREMENT PRIMARY KEY,
    Name VARCHAR(100) NOT NULL,
    Year INT,
    Category VARCHAR(100),
    Movie_ID INT,
    Person_ID INT,
    FOREIGN KEY (Movie_ID) REFERENCES Movie(ID) ON DELETE SET NULL,
    FOREIGN KEY (Person_ID) REFERENCES Person(ID) ON DELETE SET NULL,
    UNIQUE (Movie_ID, Category, Year)
) ENGINE=InnoDB;

-- Trigger for Year Validation (Insert)
DELIMITER //
CREATE TRIGGER trigger_validate_award_year_insert
BEFORE INSERT ON Award
FOR EACH ROW
BEGIN
    IF NEW.Year < 1900 OR NEW.Year > YEAR(CURDATE()) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Year must be between 1900 and the current year';
    END IF;
END //
DELIMITER ;

-- Trigger for Year Validation (Update)
DELIMITER //
CREATE TRIGGER trigger_validate_award_year_update
BEFORE UPDATE ON Award
FOR EACH ROW
BEGIN
    IF NEW.Year < 1900 OR NEW.Year > YEAR(CURDATE()) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Year must be between 1900 and the current year';
    END IF;
END //
DELIMITER ;


CREATE TABLE Recommendation (
    User_ID INT,
    Movie_ID INT,
    Score DECIMAL(5,4),
    PRIMARY KEY (User_ID, Movie_ID),
    FOREIGN KEY (User_ID) REFERENCES User(ID) ON DELETE CASCADE,
    FOREIGN KEY (Movie_ID) REFERENCES Movie(ID) ON DELETE CASCADE,
    CONSTRAINT chk_score CHECK (Score BETWEEN 0 AND 1)
) ENGINE=InnoDB;

-- Indexes
CREATE INDEX idx_movie_title ON Movie(Title);
CREATE INDEX idx_review_movie_id ON Review(Movie_ID);
CREATE INDEX idx_role_movie_person ON Role(Movie_ID, Person_ID);

-- Trigger to Update Movie Rating
DELIMITER //
CREATE TRIGGER trigger_update_rating
AFTER INSERT ON Review
FOR EACH ROW
BEGIN
    UPDATE Movie
    SET Rating = (
        SELECT AVG(Rating)
        FROM Review
        WHERE Movie_ID = NEW.Movie_ID
    )
    WHERE ID = NEW.Movie_ID;
END;
//
DELIMITER ;

-- Trigger to Prevent Duplicate Awards
DELIMITER //
CREATE TRIGGER trigger_prevent_duplicate_award
BEFORE INSERT ON Award
FOR EACH ROW
BEGIN
    DECLARE award_count INT;
    SELECT COUNT(*) INTO award_count
    FROM Award
    WHERE Movie_ID = NEW.Movie_ID
    AND Category = NEW.Category
    AND Year = NEW.Year;
    IF award_count > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Duplicate award for movie in category for year';
    END IF;
END;
//
DELIMITER ;

-- Stored Procedure to Insert Movie
DELIMITER //
CREATE PROCEDURE insert_movie(
    IN p_title VARCHAR(255),
    IN p_release_date DATE,
    IN p_duration INT,
    IN p_metadata JSON,
    IN p_director_id INT,
    IN p_producer_id INT,
    IN p_actor_ids TEXT, -- Comma-separated actor IDs
    IN p_actor_roles TEXT, -- Comma-separated roles
    IN p_genre_ids TEXT -- Comma-separated genre IDs
)
BEGIN
    DECLARE v_movie_id INT;
    DECLARE v_actor_id INT;
    DECLARE v_actor_role VARCHAR(100);
    DECLARE v_genre_id INT;
    DECLARE v_pos INT;
    DECLARE v_next_pos INT;
    DECLARE v_actor_ids_str VARCHAR(1000);
    DECLARE v_actor_roles_str VARCHAR(1000);
    DECLARE v_genre_ids_str VARCHAR(1000);

    START TRANSACTION;

    -- Insert Movie
    VALUES (p_title, p_release_date, p_duration, p_metadata);
    SET v_movie_id = LAST_INSERT_ID();

    -- Insert Director Role
    VALUES (v_movie_id, p_director_id, 'Director');

    -- Insert Producer Role
    VALUES (v_movie_id, p_producer_id, 'Producer');

    -- Parse and Insert Actor Roles
    SET v_actor_ids_str = p_actor_ids;
    SET v_actor_roles_str = p_actor_roles;
    SET v_pos = 1;
    WHILE v_pos <= LENGTH(v_actor_ids_str) DO
        SET v_next_pos = LOCATE(',', v_actor_ids_str, v_pos);
        IF v_next_pos = 0 THEN
            SET v_next_pos = LENGTH(v_actor_ids_str) + 1;
        END IF;
        SET v_actor_id = SUBSTRING(v_actor_ids_str, v_pos, v_next_pos - v_pos);
        SET v_actor_role = SUBSTRING(v_actor_roles_str, v_pos, v_next_pos - v_pos);
        VALUES (v_movie_id, v_actor_id, 'Actor', v_actor_role);
        SET v_pos = v_next_pos + 1;
    END WHILE;

    -- Parse and Insert Genres
    SET v_genre_ids_str = p_genre_ids;
    SET v_pos = 1;
    WHILE v_pos <= LENGTH(v_genre_ids_str) DO
        SET v_next_pos = LOCATE(',', v_genre_ids_str, v_pos);
        IF v_next_pos = 0 THEN
            SET v_next_pos = LENGTH(v_genre_ids_str) + 1;
        END IF;
        SET v_genre_id = SUBSTRING(v_genre_ids_str, v_pos, v_next_pos - v_pos);
        VALUES (v_movie_id, v_genre_id);
        SET v_pos = v_next_pos + 1;
    END WHILE;

    COMMIT;
END;
//
DELIMITER ;

-- Stored Procedure for Recommendations
DELIMITER //
CREATE PROCEDURE generate_recommendations(IN p_user_id INT)
BEGIN
    SELECT p_user_id, m.ID, (
        SELECT COUNT(*) / (
            SELECT COUNT(*) FROM Movie_Genre mg2 WHERE mg2.Movie_ID = m.ID
        )
        FROM Movie_Genre mg
        JOIN Review r ON r.Movie_ID = mg.Movie_ID
        WHERE r.User_ID = p_user_id
        AND mg.Genre_ID IN (
            SELECT mg3.Genre_ID
            FROM Movie_Genre mg3
            JOIN Review r2 ON r2.Movie_ID = mg3.Movie_ID
            WHERE r2.User_ID = p_user_id
            AND r2.Rating >= 7
        )
    ) AS score
    FROM Movie m
    WHERE m.ID NOT IN (
        SELECT Movie_ID FROM Review WHERE User_ID = p_user_id
    )
    HAVING score > 0
    ON DUPLICATE KEY UPDATE Score = VALUES(Score);
END;
//
DELIMITER ;


