-- Complex Queries
-- 1. Movies by Director
SELECT m.Title, m.Release_Date, m.Rating
FROM Movie m
JOIN Role r ON m.ID = r.Movie_ID
JOIN Person p ON r.Person_ID = p.ID
WHERE r.Role_Type = 'Director' AND p.Name = 'Christopher Nolan';

-- 2. Top Genres by Average Rating
SELECT g.Name, AVG(m.Rating) AS AvgRating
FROM Movie m
JOIN Movie_Genre mg ON m.ID = mg.Movie_ID
JOIN Genre g ON mg.Genre_ID = g.ID
GROUP BY g.Name
ORDER BY AvgRating DESC
LIMIT 5;

-- 3. Actors in Multiple Movies (Lowered Threshold to 2 Movies)
SELECT p.Name, COUNT(r.Movie_ID) AS MovieCount
FROM Person p
JOIN Role r ON p.ID = r.Person_ID
WHERE r.Role_Type = 'Actor'
GROUP BY p.ID, p.Name
HAVING COUNT(r.Movie_ID) >= 2
LIMIT 5;

-- 4. Recent High-Rated Movies
SELECT Title, Release_Date, Rating
FROM Movie
WHERE Release_Date >= DATE_SUB(CURDATE(), INTERVAL 10 YEAR)
AND Rating > 8.0;

-- 5. Recent lowest rated movies
SELECT Title, Release_Date, Rating
FROM Movie
WHERE Release_Date >= DATE_SUB(CURDATE(), INTERVAL 15 YEAR)
AND Rating <= 7.0
LIMIT 5;

-- 6. Movie Count by Decade
SELECT FLOOR(YEAR(Release_Date) / 10) * 10 AS Decade,
       COUNT(*) AS MovieCount
FROM Movie
GROUP BY Decade
ORDER BY Decade;

-- 7. Most Awarded Movies
SELECT m.Title, COUNT(a.ID) AS AwardCount
FROM Movie m
JOIN Award a ON m.ID = a.Movie_ID
GROUP BY m.ID, m.Title
ORDER BY AwardCount DESC
LIMIT 5;

-- 8. Active Users by Review Count
SELECT u.Username, COUNT(r.ID) AS ReviewCount
FROM User u
JOIN Review r ON u.ID = r.User_ID
GROUP BY u.ID, u.Username
HAVING COUNT(r.ID) >= 5;

-- 9. High-Rated Directors (Lowered Movie Count to 2)
SELECT p.Name, AVG(m.Rating) AS AvgMovieRating
FROM Person p
JOIN Role r ON p.ID = r.Person_ID
JOIN Movie m ON r.Movie_ID = m.ID
WHERE r.Role_Type = 'Director' AND m.Rating IS NOT NULL
GROUP BY p.ID, p.Name
HAVING COUNT(m.ID) >= 2
ORDER BY AvgMovieRating DESC
LIMIT 5;

-- 10. Genre Overlap Analysis
SELECT g1.Name AS Genre1, g2.Name AS Genre2, COUNT(*) AS MovieCount
FROM Movie_Genre mg1
JOIN Movie_Genre mg2 ON mg1.Movie_ID = mg2.Movie_ID AND mg1.Genre_ID < mg2.Genre_ID
JOIN Genre g1 ON mg1.Genre_ID = g1.ID
JOIN Genre g2 ON mg2.Genre_ID = g2.ID
GROUP BY g1.ID, g2.ID, g1.Name, g2.Name
ORDER BY MovieCount DESC
LIMIT 5;